      "date": "1731-01-18",
      "tags_section": "Es werden zum Verkauf offerirt:",
      "ntokens": 18,
      "text": "7. Ein gut Pfuhl / wovon drey Bettlöben zugleich sizen auff breithen Leinen / sambt dazu gehörigen Ziech."
